O M3DMIX é um aplicativo criado para visualizar modelos 3D das imagens de Tomografia Computadorizada, Ressonância Magnética, Medicina Nuclear ou Ultrassom.

Faz uso das Realidades Virtual e Aumentada para facilitar a comunicação entre médicos e pacientes. Ajuda pacientes a entenderem melhor as informações contidas em seus estudos de imagem.

Também serve para troca de informações entre profissionais da saúde, professores e alunos, uma excelente ferramenta para uso acadêmico e de auxílio na discussão de casos.

No modo de Realidade Virtual, o aplicativo permite girar, aproximar e deslocar os modelos 3D de seus exames. Quando no modo de Realidade Aumenta, combina os modelos 3D com o ambiente real ou até mesmo com biomodelos impressos.

Funcionalidades

-    alternar entre visualizações em Realidade Virtual e Aumentada;
-    deslocar, girar e aproximar os modelos 3D;
-    alterar cores e transparência das diferentes partes dos modelos;
-    tirar fotos das visualizações;
-    criar vídeos das visualizações em Realidade Aumentada;
-    compartilhar projetos

IMPORTANTE! Esse aplicativo não serve para diagnóstico, tem por objetivo apenas facilitar a visualização de imagens tomográficas.
